import React from 'react';
import Media1 from '../components/Media1';
import MapBe from '../components/MapBe'
import { Col, Row, Card } from 'react-bootstrap';


function Home() {
    return (
        <Card style={{ border: "3px #138086 solid", padding: '0px', margin: "0px" }}>
            <Row>


                <Col sm={5} style={{ direction: 'rtl', overflowY: 'auto', overflowX: ' hidden', backgroundColor: 'lightblue', height: '600px' }}>
                    <Media1 />

                </Col>
                <Col sm={7}><MapBe /></Col>
            </Row>
        </Card>


    );
}

export default Home;
